import React from 'react';
import Button from 'react-bootstrap/Button';
import Card from 'react-bootstrap/Card'
import './UserItem.css';

const userAttendanceItem = props => (
  <li key={props.userId} className="users__list-item">
    <div>

    <Card style={{ width: '18rem' }}>
      <Card.Body>
        <Card.Title>
          Date:
        </Card.Title>

        <Card.Text>

        </Card.Text>
        <Card.Link href="#">
        { props.canDelete === true && (
          <Button variant="danger" onClick={props.onDelete.bind(this, props.attendance)}>
            Delete
          </Button>
        )}
        </Card.Link>
      </Card.Body>
    </Card>

    <h5 className="userItemHeading"> Date:</h5>
    <p className="userItemText">
    {props.date}
    </p>

    <h5 className="userItemHeading"> Status:</h5>
    <p className="userItemText">
    {props.status}
    </p>

    <h5 className="userItemHeading"> Description:</h5>
    <p className="userItemText">
    {props.description}
    </p>

    </div>
    { props.canDelete === true && (
      <Button variant="danger" onClick={props.onDelete.bind(this, props.attendance)}>
        Delete
      </Button>
    )}
  </li>
);

export default userAttendanceItem;
